import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
	return (
		<div className="App">
			<table
				style={{
					backgroundColor: '#000',
					display: 'block',
					color: '#fff',
				}}>
				<tbody>
					<tr>
						<td>
							<img alt="app icon" width="50" src="green_app_icon.svg" />
						</td>
						<td>hMovies Search</td>
					</tr>
				</tbody>
			</table>
		</div>
	);
}

export default App;
